let result = null

export default function Comp1 () {
  if (result === null) {
    throw new Promise((resolve, reject) => {
      setTimeout(resolve => {
        resolve('Hello Akshay')
      }, 5000)
    })
      .then(res => {
        result = res
      })
      .then(err => {
        result = err
      })
  }
}
